export const resetReportGroupListExtended = () => {
  return {
    type: 'REPORTING_EXTENDED_RESET_REPORT_GROUP_LIST',
  };
};

// This will be removed after the POC by API team.
export const setReportDetailBool = (boolValue) => {
  return {
    type: 'REPORTING_EXTENDED_SET_REPORT_DETAIL_BOOL',
    payload: boolValue,
  };
};
